(self.webpackChunkblog=self.webpackChunkblog||[]).push([[2509],{6464:(a,t,e)=>{"use strict";e.r(t),e.d(t,{data:()=>r});const r={key:"v-8daa1a0e",path:"/",title:"开篇",lang:"zh-US",frontmatter:{},excerpt:"",headers:[{level:3,title:"Stay hungry, Stay foolish.",slug:"stay-hungry-stay-foolish",children:[]}],filePathRelative:"README.md"}},1933:(a,t,e)=>{"use strict";e.r(t),e.d(t,{default:()=>h});const r=(0,e(6252).uE)('<h1 id="开篇" tabindex="-1"><a class="header-anchor" href="#开篇" aria-hidden="true">#</a> 开篇</h1><p>在我看来，<strong>前端</strong>是一个编程领域中相对特殊的行业，不同于Java、大数据等编程领域，学校一般不会开设这门学科相关的专业，大部分同学都是通过自学或培训进入这个行业。</p><p>虽然其发展史不算长，从JavaScript诞生到现在也不过20多年，但其知识体系之杂，更迭速度之快是其他编程语言不能比拟的。这就对前端同学有了更高的要求，不仅要灵活运行学到的知识，还要不断深入理解相关原理。</p><p>如今新领域层出不穷，有时候学习的进度赶不上技术迭代的进度，在此大环境下，<strong>搭建完善的知识体系</strong>就显得格外重要，接下来我会在这分享平时记录积累的各类知识点，和一些其他技术好文，希望对大家有所裨益。</p><h3 id="stay-hungry-stay-foolish" tabindex="-1"><a class="header-anchor" href="#stay-hungry-stay-foolish" aria-hidden="true">#</a> Stay hungry, Stay foolish.</h3>',5),h={render:function(a,t){return r}}}}]);